import React from 'react';
import './DiamondAnimation.css';

const DiamondAnimation = () => {
  return (
    <div className="diamond-container">
      <div className="diamond-animation">
        <div className="diamond">
          <div className="diamond-face front ring-image"></div>
          <div className="diamond-face back ring-image"></div>
          <div className="diamond-face right ring-image"></div>
          <div className="diamond-face left ring-image"></div>
          <div className="diamond-face top ring-image"></div>
          <div className="diamond-face bottom ring-image"></div>
        </div>
      </div>
    </div>
  );
};

export default DiamondAnimation;
